  false,\n\t\"url\": null,\n\t\"notes\": \"Geochemical behavior of the upper 70 cm
  of permeable reef flat sediments on Checker Reef, Oahu, Hawaii was examined using
  spatial and temporal changes in pore water dissolved oxygen, nitrate, nitrite, ammonium,
  and nitrous oxide. This patch reef was monitored immediately following significant
  wave events (storm events) between October 1996 and July 1997 to study the hydraulic
  control of pore water geochemistry within the oxic-suboxic zone of a permeable sediment.\",\n\t\"license_title\":
